import React, { useEffect, useState } from "react";

function App() {
    const Submit = (det) => {
        fetch("http://192.168.43.117:5000/values"
        , {
          method: "POST",
          headers: {
            Accept: "application/json",
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            details: det,
          }),
        })
          .then((res) => res.json())
          .then(values => {
            console.log(values);
          })
      };

      return (
        <div>
            <form onSubmit={() => Submit("a")}>
                    <a>Enter the name:</a>

                    <button >Submit</button>
            </form>
        </div>

      );
    }

export default App;
